{{Han etym}}
One of the three characters ({{m|zh|無}}, {{m|zh|无}}, {{m|zh|亡}}) that have historically been used to represent the word "no, not any". First attested in the {{w|Warring States period}}; used interchangeably with {{m|zh|無}} until the {{w|Tang dynasty}}. Readopted by the {{w|People's Republic of China|PRC}} in 1956.

The origin of this character is unknown. Probably an ancient variant form of either {{m|zh|元}}, {{m|zh|天}} or {{m|zh|堯}}.
